       "<li><i>Monitoring quality/and quality control of results for department </i></li>\n",
       "<li><i>Responsible for ensuring overall metrics are in compliance with management and client expectations</i></li>\n",
       "<li><i>Responsible for human resources matters directly related to department supervised (i.e. Interviewing, Hiring, Training, annual evaluations, electronic time cards, and addressing personnel issues)</i></li>\n",
       "<li>May create/review daily, weekly, monthly reports, invoices, logs and expenses</li>\n",
       "<li><i>Additional duties/responsibilities as assigned </i></li>\n",
       "<li><i>Comply with all safety rules/regulations, in conjunction with the Injury and Illness Prevention Program (“IIPP”), as well as, maintain HIPAA compliance</i></li>\n",
       "<li>\n",
       "<i>Occasional interaction with customers</i><b> </b>\n",
       "</li>\n",
       "</ul><p></p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             & <p><b>QUALIFICATIONS:</b></p>\n",
       "<ul>\n",
       "<li>RN license in the State of Texas</li>\n",
       "<li>Diploma or Bachelors of Science in Nursing, required</li>\n",
       "<li>Past managerial experience, preferred</li>\n",
       "<li>6 + years’ experience as OR Nurse</li>\n",
       "<li>Experience with facility bills helpful</li>\n",
       "<li>Strong knowledge of ICD9/CPT</li>\n",
       "<li>Knowledge of Fee Schedules, Rules and R\\&amp;C Guidelines</li>\n",
       "<li>Must be able to remain poised in stressful situations</li>\n",
       "</ul><ul>\n",
       "<li>Highly Motivated, Self-Starter</li>\n",
       "<li>Exceptional organizational skills</li>\n",
       "<li>Ability to handle deadlines and proactively problem solve</li>\n",
       "<li>Effective and professional communication skills</li>\n",
       "<li>Ability to meet or exceed Performance Competencies</li>\n",
       "<li>Demonstrated outstanding leadership, problem solving, and analytical skills</li>\n",
       "<li>Ability to think and work independently, while working in an overall team environment</li>\n",
       "<li>Proficient in Microsoft Office Suite</li>\n",
       "</ul>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                 & <p>Full Benefits Offered</p>                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                       & f & t & t & Full-time & Mid-Senior level & Bachelor's Degree & Hospital \\& Health Care    & Health Care Provider & f & f\\\\\n",
       "\t6 & Accounting Clerk                          & US, MD,            &           &  &                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                      & <p><b>Job Overview</b></p>\n",
       "<p>Apex is an environmental consulting firm that offers stable leadership and growth and views employees as valuable resources. We are seeking a self-motivated, multi-faceted <b>Accounts Payable Clerk </b>to join our team in Rockville, MD and become an integral part of our continued success story.  This position entails processing high volume of invoices and working in a fast pace environment; keying and verifying various types of invoices to General Ledger accounts and job numbers submitted by vendors and company personnel; and calculating balance due to vendor by reviewing history of prior payments made to an account. Candidate must be able to answer vendor and personnel inquiries via phone or email.<b> </b></p>\n",
       "<p><b>Qualifications</b></p>\n",
       "<p>This position requires a high school diploma and 2-5 years of relevant work experience; keen attention to detail; knowledge of commonly-used concepts, practices, and procedures within the accounting field; experience with accounting software; proficiency in MS Office Suite including advanced Excel experience; and a high degree of professionalism.</p>\n",
       "<p>Want to join a team of talented accounting professionals, engineers, and managers? Submit your resume for consideration today!</p>\n",
       "<p><a href=\"\\#URL\\_e6a5b66a01c547b3aeaab6264036e96fa6feb9e6050ef1345304bb235094fe39\\#\">\\#URL\\_f030e16ff4531e87a62857357985e3e8f1fdedb40dbfebfeb0e7e3a5ead65097\\#</a></p>\n",
       "<p><b>About Apex</b></p>\n",
       "<p>Apex is a customer-focused company that delivers environmental, health, safety and engineering services to over 700 clients across the United States and abroad. Driven by an entrepreneurial spirit and a dedication to providing responsive, cost-effective solutions, Apex has grown rapidly since our founding in 1988.</p>\n",
       "<p>Working in partnership with our public and private sector clients, our team of experts provides services tailored to support each customer’s unique goals and objectives. By blending strong technical skills, business acumen, and superior customer service, we are able to deliver creative solutions that deliver high quality results at low cost.</p>\n",
       "<p>From commercial and industrial firms to construction, petroleum, and utility companies to financial institutions and government clients, Apex has extensive experience in a wide variety of industries. Our corporate professional resume includes proven capabilities in the areas of water resources, remediation and restoration, assessment and compliance, and industrial hygiene, among others.</p>\n",
       "<p>Ranked in the Top 200 Environmental Firms by ENR Magazine, ranked among the Top 500 Design Firms by ENR Magazine, awarded the 2011 National Environmental Excellence Award for Environmental Stewardship by the National Association of Environmental Professionals, and selected as a 2010 Hot Firm by the Zweig Letter, come join our award winning team.</p>\n",
       "<p>Apex is an entrepreneurial firm, and ensuring that our senior managers are able to move unencumbered is our priority. We are a successful and growing mid-sized firm. We’re small enough that our employees still have access to our leadership, and it’s easy for high-performers to be recognized for their contributions and advance without bureaucracy. With over 30 office locations, we’re big enough to provide comprehensive environmental consulting and engineering services to our diverse client base and to provide resources to our employees to help in their professional development. We offer incentive bonus plans and ownership opportunities for our successful managers.</p>\n",
       "<p><i>Apex Companies, LLC is an Affirmative Action/Equal Opportunity Employer</i><i></i></p>\n",
       "<p></p> &                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                             &                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    & f & f & f &           &                  &                   &                           &                      & f & f\\\\\n",
       "\\end{tabular}\n"
      ],
