       "| 1 | Marketing Intern                          | US, NY, New York   | Marketing | <!----> | &lt;h3&gt;We're Food52, and we've created a groundbreaking and award-winning cooking site. We support, connect, and celebrate home cooks, and give them everything they need in one place.&lt;/h3&gt;\n",
       "&lt;p&gt;We have a top editorial, business, and engineering team. We're focused on using technology to find new and better ways to connect people around their specific food interests, and to offer them superb, highly curated information about food and cooking. We attract the most talented home cooks and contributors in the country; we also publish well-known professionals like Mario Batali, Gwyneth Paltrow, and Danny Meyer. And we have partnerships with Whole Foods Market and Random House.&lt;/p&gt;\n",
       "&lt;p&gt;Food52 has been named the best food website by the James Beard Foundation and IACP, and has been featured in the New York Times, NPR, Pando Daily, TechCrunch, and on the Today Show.&lt;/p&gt;\n",
       "&lt;p&gt;We're located in Chelsea, in New York City.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                            | &lt;p&gt;Food52, a fast-growing, James Beard Award-winning online food community and crowd-sourced and curated recipe hub, is currently interviewing full- and part-time unpaid interns to work in a small team of editors, executives, and developers in its New York City headquarters.&lt;/p&gt;\n",
       "&lt;ul&gt;\n",
       "&lt;li&gt;Reproducing and/or repackaging existing Food52 content for a number of partner sites, such as Huffington Post, Yahoo, Buzzfeed, and more in their various content management systems&lt;/li&gt;\n",
       "&lt;li&gt;Researching blogs and websites for the Provisions by Food52 Affiliate Program&lt;/li&gt;\n",
       "&lt;li&gt;Assisting in day-to-day affiliate program support, such as screening affiliates and assisting in any affiliate inquiries&lt;/li&gt;\n",
       "&lt;li&gt;Supporting with PR &amp;amp; Events when needed&lt;/li&gt;\n",
       "&lt;li&gt;Helping with office administrative work, such as filing, mailing, and preparing for meetings&lt;/li&gt;\n",
       "&lt;li&gt;Working with developers to document bugs and suggest improvements to the site&lt;/li&gt;\n",
       "&lt;li&gt;Supporting the marketing and executive staff&lt;/li&gt;\n",
       "&lt;/ul&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   | &lt;ul&gt;\n",
       "&lt;li&gt;Experience with content management systems a major plus (any blogging counts!)&lt;/li&gt;\n",
       "&lt;li&gt;Familiar with the Food52 editorial voice and aesthetic&lt;/li&gt;\n",
       "&lt;li&gt;Loves food, appreciates the importance of home cooking and cooking with the seasons&lt;/li&gt;\n",
       "&lt;li&gt;Meticulous editor, perfectionist, obsessive attention to detail, maddened by typos and broken links, delighted by finding and fixing them&lt;/li&gt;\n",
       "&lt;li&gt;Cheerful under pressure&lt;/li&gt;\n",
       "&lt;li&gt;Excellent communication skills&lt;/li&gt;\n",
       "&lt;li&gt;A+ multi-tasker and juggler of responsibilities big and small&lt;/li&gt;\n",
       "&lt;li&gt;Interested in and engaged with social media like Twitter, Facebook, and Pinterest&lt;/li&gt;\n",
       "&lt;li&gt;Loves problem-solving and collaborating to drive Food52 forward&lt;/li&gt;\n",
       "&lt;li&gt;Thinks big picture but pitches in on the nitty gritty of running a small company (dishes, shopping, administrative support)&lt;/li&gt;\n",
       "&lt;li&gt;Comfortable with the realities of working for a startup: being on call on evenings and weekends, and working long hours&lt;/li&gt;\n",
       "&lt;/ul&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                    | <!----> | f | t | f | Other     | Internship       | <!----> | <!----> | Marketing            | f | f |\n",
       "| 2 | Customer Service - Cloud Video Production | NZ, , Auckland     | Success   | <!----> | &lt;h3&gt;90 Seconds, the worlds Cloud Video Production Service.&lt;/h3&gt;\n",
       "&lt;p&gt;90 Seconds is the worlds Cloud Video Production Service enabling brands and agencies to get high quality online video content shot and produced anywhere in the world. 90 Seconds makes video production fast, affordable, and all managed seamlessly in the cloud from purchase to publish. &lt;a href=\"http://90#URL_fbe6559afac620a3cd2c22281f7b8d0eef56a73e3d9a311e2f1ca13d081dd630#\" rel=\"nofollow\" class=\"external\"&gt;http://90#URL_fbe6559afac620a3cd2c22281f7b8d0eef56a73e3d9a311e2f1ca13d081dd630#&lt;/a&gt;&lt;/p&gt;\n",
       "&lt;p&gt;&lt;/p&gt;\n",
       "&lt;p&gt;90 Seconds removes the hassle, cost, risk and speed issues of working with regular video production companies by managing every aspect of video projects in a beautiful online experience. With a growing global network of over 2,000 rated video professionals in over 50 countries managed by dedicated production success teams in 5 countries, 90 Seconds provides a 100% success guarantee.&lt;/p&gt;\n",
       "&lt;p&gt;90 Seconds has produced almost 4,000 videos in over 30 Countries for over 500 Global brands including some of the worlds largest including Paypal, L’Oreal, Sony and Barclays and has offices in Auckland, London, Sydney, Tokyo and Singapore.&lt;/p&gt;\n",
       "&lt;p&gt;&lt;a href=\"http://90#URL_fbe6559afac620a3cd2c22281f7b8d0eef56a73e3d9a311e2f1ca13d081dd630#\" rel=\"nofollow\" class=\"external\"&gt;http://90#URL_fbe6559afac620a3cd2c22281f7b8d0eef56a73e3d9a311e2f1ca13d081dd630#&lt;/a&gt; | &lt;a href=\"http://90#URL_e2ad0bde3f09a0913a486abdbb1e6ac373bb3310f64b1fbcf550049bcba4a17b#\" rel=\"nofollow\" class=\"external\"&gt;http://90#URL_e2ad0bde3f09a0913a486abdbb1e6ac373bb3310f64b1fbcf550049bcba4a17b#&lt;/a&gt; | &lt;a href=\"http://90#URL_8c5dd1806f97ab90876d9daebeb430f682dbc87e2f01549b47e96c7bff2ea17e#\" rel=\"nofollow\" class=\"external\"&gt;http://90#URL_8c5dd1806f97ab90876d9daebeb430f682dbc87e2f01549b47e96c7bff2ea17e#&lt;/a&gt; &lt;/p&gt; | &lt;p&gt;Organised - Focused - Vibrant - Awesome!&lt;br&gt;&lt;br&gt;Do you have a passion for customer service? Slick typing skills? Maybe Account Management? ...And think administration is cooler than a polar bear on a jetski? Then we need to hear you! &lt;/p&gt;\n",
       "&lt;p&gt;We are the Cloud Video Production Service and opperating on a glodal level. Yeah, it's pretty cool. Serious about delivering a world class product and excellent customer service.&lt;br&gt;&lt;br&gt;Our rapidly expanding business is looking for a talented Project Manager to manage the successful delivery of video projects, manage client communications and drive the production process. Work with some of the coolest brands on the planet and learn from a global team that are representing NZ is a huge way!&lt;br&gt;&lt;br&gt;&lt;/p&gt;\n",
       "&lt;p&gt;We are entering the next growth stage of our business and growing quickly internationally.  Therefore, the position is bursting with opportunity for the right person entering the business at the right time. &lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;90 Seconds, the worlds Cloud Video Production Service - http://90#URL_fbe6559afac620a3cd2c22281f7b8d0eef56a73e3d9a311e2f1ca13d081dd630#&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;90 Seconds is the worlds Cloud Video Production Service enabling brands and agencies to get high quality online video content shot and produced anywhere in the world. Fast, affordable, and all managed seamlessly in the cloud from purchase to publish. &lt;br&gt;&lt;br&gt;90 Seconds removes the hassle, cost, risk and speed issues of working with regular video production companies by managing every aspect of video projects in a beautiful online experience.  With a growing network of over 2,000 rated video professionals in over 50 countries and dedicated production success teams in 5 countries guaranteeing video project success 100%. It's as easy as commissioning a quick google adwords campaign.&lt;br&gt;&lt;br&gt;90 Seconds has produced almost 4,000 videos in over 30 Countries for over 500 Global brands including some of the worlds largest including Paypal, L'oreal, Sony and Barclays and has offices in Auckland, London, Sydney, Tokyo &amp;amp; Singapore.&lt;br&gt;&lt;br&gt;Our Auckland office is based right in the heart of the Wynyard Quarter Innovation Precinct - GridAKL! &lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                              | &lt;p&gt;&lt;b&gt;What we expect from you:&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;Your key responsibility will be to communicate with the client, 90 Seconds team and freelance community throughout the video production process including, shoot planning, securing freelance talent, managing workflow and the online production management system.  The aim is to manage each video project effectively so that we produce great videos that our clients love.&lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;Key&lt;/b&gt; &lt;b&gt;attributes&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;ul&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Client focused&lt;/b&gt; - excellent customer service and communication skills&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Online - &lt;/b&gt;oustanding computer knowledge and experience using online software and project management tools&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Organised&lt;/b&gt; - manage workload and able to multi-task100% attention to detail&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Motivated -&lt;/b&gt; self-starter with a passion for doing excellent work and achieving great results&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Adaptable&lt;/b&gt; - show initiative and think on your feet as this is a constantly evolving atmosphere&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Flexible&lt;/b&gt; - fast turnaround work and after hours availability&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Easy going&lt;/b&gt; &lt;b&gt;&amp;amp; upbeat&lt;/b&gt; - dosen't get bogged down and loves the challenge&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Sense of Humour &lt;/b&gt;- have a laugh and know that working in a startup takes guts!&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;Ability to deliver&lt;/b&gt; - including meeting project deadlines and budget&lt;br&gt;&lt;br&gt;Attitude is more important than experience at 90 Seconds, however previous experience in customer service and/or project management is beneficial&lt;br&gt;&lt;br&gt;&lt;i&gt;Please view our platform / website at &lt;a href=\"#URL_4a485eaa77806ed62da65a29b406d19e21bfa4fd60b786aa11d45b#PHONE_ac8ee99b2fd18e5826a16f77a83e674359852a65d180c450b6127566557bd127##\"&gt;#URL_395a8683a907ce95f49a12fb240e6e47ad8d5a4f96d07ebbd869c4dd4dea1826#&lt;/a&gt; and get a clear understand about what we do before reaching out.&lt;/i&gt;\n",
       "&lt;/li&gt;\n",
       "&lt;/ul&gt; | &lt;h3&gt;&lt;b&gt;What you will get from us&lt;/b&gt;&lt;/h3&gt;\n",
       "&lt;p&gt;Through being part of the 90 Seconds team you will gain:&lt;/p&gt;\n",
       "&lt;ul&gt;\n",
       "&lt;li&gt;experience working on projects located around the world with an international brand&lt;/li&gt;\n",
       "&lt;li&gt;experience working with a variety of clients and on a large range of projects&lt;/li&gt;\n",
       "&lt;li&gt;opportunity to drive and grow production function and team&lt;/li&gt;\n",
       "&lt;li&gt;a positive working environment with a great team&lt;/li&gt;\n",
       "&lt;/ul&gt;&lt;p&gt;&lt;b&gt;Pay&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;$40,000-$55,000&lt;/p&gt;\n",
       "&lt;p&gt;&lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;Applying for this role with a VIDEO&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;Being a video business, we understand that one of the quickest ways that we can assess your suitability for this role, and one of the quickest ways that you can apply for it, is for you to submit a 60-90 second long video telling us about yourself, your experience and why you think you would be perfect for the role.  &lt;/p&gt;\n",
       "&lt;p&gt;It’s not about being a filmmaker or making a really creative video.  A simple video filmed with a smart phone or web cam will be fine. Please also include where you are based and when you can start.&lt;/p&gt;\n",
       "&lt;p&gt;You can upload the video onto YouTube or Vimeo (or similar) as a Draft or Live link.&lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;APPLICATIONS DUE by 5pm on Wednesday 18th July 2014 - &lt;/b&gt;Once you have a video ready, apply for this role via the following link together with a cover letter and your CV. &lt;/p&gt;\n",
       "&lt;p&gt;After we have watched your video and get an idea of your suitability for the role, we will email the shortlisted candidates&lt;/p&gt; | f | t | f | Full-time | Not Applicable   | <!----> | Marketing and Advertising | Customer Service     | f | f |\n",
       "| 3 | Commissioning Machinery Assistant (CMA)   | US, IA, Wever      | <!----> | <!----> | &lt;h3&gt;&lt;/h3&gt;\n",
       "&lt;p&gt;Valor Services provides Workforce Solutions that meet the needs of companies across the Private Sector, with a special focus on the Oil &amp;amp; Gas Industry. &lt;/p&gt;\n",
       "&lt;p&gt;Valor Services will be involved with you throughout every step of the hiring process and remain in contact with you all the way through the final step of signing of the employment contract with your new employer. &lt;/p&gt;\n",
       "&lt;p&gt;Valor Services was founded with the vision of employing the unique skills, experiences, and qualities of America’s finest veterans to provide Private Sector companies with precise and concerted value-added services – and America’s finest Veterans with an optimized career opportunity.&lt;/p&gt;\n",
       "&lt;p&gt;We are eager to get the word out to veterans that there are ample opportunities for employment in the private sector and that you are the ideal candidates to fill those positions. &lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;Valor Services &lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;&lt;i&gt;Your Success is Our Mission. ™ &lt;/i&gt;&lt;/p&gt;\n",
       "&lt;p&gt;&lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                | &lt;p&gt;Our client, located in Houston, is actively seeking an experienced Commissioning Machinery Assistant that possesses strong supervisory skills and has an attention to detail. A strong dedication to safety is a must. The ideal candidate will execute all activities while complying with quality requirements and health, environmental, and safety regulations.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   | &lt;ul&gt;\n",
       "&lt;li&gt;Implement pre-commissioning and commissioning procedures for rotary equipment.&lt;/li&gt;\n",
       "&lt;li&gt;Execute all activities with subcontractor’s assigned crew that pertains to the discipline.&lt;/li&gt;\n",
       "&lt;li&gt;Ensure effective utilization of commissioning manpower and consumables.&lt;/li&gt;\n",
       "&lt;li&gt;Ensure the execution of vendor specialists' field activities with the assigned resources from the sub-contractor per vendor’s representative plans.&lt;/li&gt;\n",
       "&lt;li&gt;Carry out equipment inspections with client representatives and ensure proper certification is produced.&lt;/li&gt;\n",
       "&lt;li&gt;Prepare forms for all pending tests and submit signed certificates for final hand over to the certification engineer for QA and QC.&lt;/li&gt;\n",
       "&lt;li&gt;Coordinate in the field with vendor representatives.&lt;/li&gt;\n",
       "&lt;li&gt;Keep records of all activities.&lt;/li&gt;\n",
       "&lt;li&gt;Ensure that safety practices are strictly followed during the execution of activities.&lt;/li&gt;\n",
       "&lt;li&gt;Report progress and constraints to the mechanical supervisor.&lt;/li&gt;\n",
       "&lt;li&gt;Possible authorization by site manager to receive or issue a Permit To Work according to project Permit To Work procedures.&lt;/li&gt;\n",
       "&lt;li&gt;Assist supervisor to expedite pending punch-list items in accordance with the commissioning manager’s priorities.&lt;/li&gt;\n",
       "&lt;li&gt;Assist supervisor to coordinate and supervise construction-support activities during pre-commissioning and commissioning activities.&lt;/li&gt;\n",
       "&lt;/ul&gt;&lt;p&gt;&lt;b&gt;Company Overview:&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;Our client is a premiere engineering, construction, and procurement company that executes large-scale projects internationally.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                        | <!----> | f | t | f | <!----> | <!----> | <!----> | <!----> | <!----> | f | f |\n",
       "| 4 | Account Executive - Washington DC         | US, DC, Washington | Sales     | <!----> | &lt;p&gt;Our passion for improving quality of life through geography is at the heart of everything we do.  Esri’s geographic information system (GIS) technology inspires and enables governments, universities and businesses worldwide to save money, lives and our environment through a deeper understanding of the changing world around them.&lt;/p&gt;\n",
       "&lt;p&gt;Carefully managed growth and zero debt give Esri stability that is uncommon in today's volatile business world.  Privately held, we offer exceptional benefits, competitive salaries, 401(k) and profit-sharing programs, opportunities for personal and professional growth, and much more.&lt;/p&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                               | &lt;p&gt;&lt;b&gt;THE COMPANY: ESRI – Environmental Systems Research Institute&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;Our passion for improving quality of life through geography is at the heart of everything we do.  Esri’s geographic information system (GIS) technology inspires and enables governments, universities and businesses worldwide to save money, lives and our environment through a deeper understanding of the changing world around them.&lt;/p&gt;\n",
       "&lt;p&gt;Carefully managed growth and zero debt give Esri stability that is uncommon in today's volatile business world.  Privately held, we offer exceptional benefits, competitive salaries, 401(k) and profit-sharing programs, opportunities for personal and professional growth, and much more.&lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;THE OPPORTUNITY: Account Executive&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;p&gt;As a member of the Sales Division, you will work collaboratively with an account team in order to sell and promote adoption of Esri’s ArcGIS platform within an organization. As part of an account team, you will be responsible for facilitating the development and execution of a set of strategies for a defined portfolio of accounts. When executing these strategies you will utilize your experience in enterprise sales to help customers leverage geospatial information and technology to achieve their business goals. &lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;&lt;i&gt;Specifically…&lt;/i&gt;&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;ul&gt;\n",
       "&lt;li&gt;Prospect and develop opportunities to partner with key stakeholders to envision, develop, and implement a location strategy for their organization&lt;/li&gt;\n",
       "&lt;li&gt;Clearly articulate the strength and value proposition of the ArcGIS platform&lt;/li&gt;\n",
       "&lt;li&gt;Develop and maintain a healthy pipeline of opportunities for business growth&lt;/li&gt;\n",
       "&lt;li&gt;Demonstrate a thoughtful understanding of insightful industry knowledge and how GIS applies to initiatives, trends, and triggers&lt;/li&gt;\n",
       "&lt;li&gt;Understand the key business drivers within an organization and identify key business stakeholders&lt;/li&gt;\n",
       "&lt;li&gt;Understand your customers’ budgeting and acquisition processes&lt;/li&gt;\n",
       "&lt;li&gt;Successfully execute the account management process including account prioritization, account resourcing, and account planning&lt;/li&gt;\n",
       "&lt;li&gt;Successfully execute the sales process for all opportunities&lt;/li&gt;\n",
       "&lt;li&gt;Leverage and lead an account team consisting of sales and other cross-divisional resources to define and execute an account strategy&lt;/li&gt;\n",
       "&lt;li&gt;Effectively utilize and leverage the CRM to manage opportunities and drive the buying process&lt;/li&gt;\n",
       "&lt;li&gt;Pursue professional and personal development to ensure competitive knowledge of the real estate industry&lt;/li&gt;\n",
       "&lt;li&gt;Leverage social media to successfully prospect and build a professional network&lt;/li&gt;\n",
       "&lt;li&gt;Participate in trade shows, workshops, and seminars (as required)&lt;/li&gt;\n",
       "&lt;li&gt;Support visual story telling through effective whiteboard sessions&lt;/li&gt;\n",
       "&lt;li&gt;Be resourceful and takes initiative to resolve issues&lt;/li&gt;\n",
       "&lt;/ul&gt;                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                                   | &lt;ul&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;EDUCATION: &lt;/b&gt;Bachelor’s or Master’s in GIS, business administration, or a related field, or equivalent work experience, depending on position level&lt;/li&gt;\n",
       "&lt;li&gt;\n",
       "&lt;b&gt;EXPERIENCE: &lt;/b&gt;5+ years of enterprise sales experience providing platform solutions to businesses&lt;/li&gt;\n",
       "&lt;li&gt;Demonstrated experience in managing the sales cycle including prospecting, proposing, and closing&lt;/li&gt;\n",
       "&lt;li&gt;Ability to adapt to new technology trends and translate them into solutions that address customer needs&lt;/li&gt;\n",
       "&lt;li&gt;Demonstrated experience with strong partnerships and advocacy with customers&lt;/li&gt;\n",
       "&lt;li&gt;Excellent presentation, white boarding, and negotiation skills including good listening, probing, and qualification abilities&lt;/li&gt;\n",
       "&lt;li&gt;Experience executing insight selling methodologies&lt;/li&gt;\n",
       "&lt;li&gt;Demonstrated understanding and mitigation of competitive threats&lt;/li&gt;\n",
       "&lt;li&gt;Excellent written and verbal communication and interpersonal skills&lt;/li&gt;\n",
       "&lt;li&gt;Ability to manage and prioritize your activities&lt;/li&gt;\n",
       "&lt;li&gt;Demonstrated experience to lead executive engagements to provide services and sell to the real estate industry&lt;/li&gt;\n",
       "&lt;li&gt;Knowledge of the real estate industry fiscal year, budgeting, and procurement cycle&lt;/li&gt;\n",
       "&lt;li&gt;Highly motivated team player with a mature, positive attitude and passion to meet the challenges and opportunities of a business&lt;/li&gt;\n",
       "&lt;li&gt;Ability to travel domestically and/or internationally up to 50%&lt;/li&gt;\n",
       "&lt;li&gt;General knowledge of spatial analysis and problem solving&lt;/li&gt;\n",
       "&lt;li&gt;Results oriented; ability to write and craft smart, attainable, realistic, time-driven goals with clear lead indicators&lt;/li&gt;\n",
       "&lt;/ul&gt;                                                                                                                                                                                                                          | &lt;p&gt;Our culture is anything but corporate—we have a collaborative, creative environment; phone directories organized by first name; a relaxed dress code; and open-door policies.&lt;/p&gt;\n",
       "&lt;p&gt;&lt;b&gt;A Place to Thrive&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;ul&gt;\n",
       "&lt;li&gt;Passionate people who strive to make a difference&lt;/li&gt;\n",
       "&lt;li&gt;Casual dress code&lt;/li&gt;\n",
       "&lt;li&gt;Flexible work schedules&lt;/li&gt;\n",
       "&lt;li&gt;Support for continuing education&lt;/li&gt;\n",
       "&lt;/ul&gt;&lt;p&gt;&lt;b&gt;College-Like Campus&lt;/b&gt;&lt;/p&gt;\n",
       "&lt;ul&gt;\n",
       "&lt;li&gt;A network of buildings amid lush landscaping and numerous outdoor patio areas&lt;/li&gt;\n",
