    "library(ggplot2)\n",
    "library(dplyr)\n",
    "\n",
    "# Function to prepare data\n",
    "prepare_location_data <- function(data, label) {\n",
    "  location_words <- strsplit(tolower(data$location), \"\\\\W+\") %>%\n",
    "    unlist() %>%\n",
    "    {.[! . %in% c(\"a\", \"an\", \"and\", \"the\", \"of\", \"in\", \"for\", \"on\", \"at\", \"with\", \"by\", \"to\")]}\n",
    "  \n",
    "  word_freq_location <- table(location_words)\n",
    "  sorted_word_freq_location <- sort(word_freq_location, decreasing = TRUE)\n",
    "  top_20_words_location <- head(sorted_word_freq_location, 20)\n",
    "  \n",
    "  data_frame_location <- data.frame(word = names(top_20_words_location), frequency = as.numeric(top_20_words_location))\n",
    "  data_frame_location$label <- label\n",
    "  return(data_frame_location)\n",
    "}\n",
    "\n",
    "# Prepare data for both fraudulent and non-fraudulent posts\n",
    "location_word_freq_df_fraud <- prepare_location_data(fraudulent_posts, \"Fraudulent\")\n",
    "location_word_freq_df_non_fraud <- prepare_location_data(non_fraudulent_posts, \"Non-Fraudulent\")\n",
    "\n",
    "# Combine the datasets\n",
    "location_word_freq_df_combined <- rbind(location_word_freq_df_fraud, location_word_freq_df_non_fraud)\n",
    "\n",
    "# Create a combined plot with facets\n",
    "ggplot(location_word_freq_df_combined, aes(x = reorder(word, frequency), y = frequency, fill = label)) +\n",
    "  geom_bar(stat = \"identity\") +\n",
    "  labs(title = \"Top 20 Most Frequent Words in Location Column\", subtitle = \"Comparison between Fraudulent and Non-Fraudulent Job Postings\",\n",
    "       x = \"Word\", y = \"Frequency\") +\n",
    "  facet_wrap(~ label, scales = \"free_x\") +\n",
    "  theme(axis.text.x = element_text(angle = 45, hjust = 1), legend.position = \"bottom\")\n"
   ]
  },
